import React, { Component } from 'react';
import F1InfoAPI from "../../API/InfoAPI";
import Select from 'react-select';


class SelectSceleton extends Component<any> {
    state = {
        selectedOption: null,
    };

    render() {

        const { selectedOption } = this.state;
        const options = new F1InfoAPI()
        async function fetchData() {
            try {
                const result: any[] = await options.Drivers("f1/info/drivers");
                // Now you have the data in the 'result' variable as an array.
                console.log("Options", result);

                // You can use 'result' as a constant variable in your component.
            } catch (error) {
                // Handle errors here
            }
        }

        fetchData();
        return (
            <Select
                value={selectedOption}
                //onChange={this.handleChange}
                options={options}
            />
        );
    }
}

export default SelectSceleton;
